import {SignInWithGooglePopup,createUserDoocumentFromAuth} from '../../utils/firebase/firebase.utils'

const SignIn = () => {
    const logGoogleUser = async() => {
        const {user} = await SignInWithGooglePopup();
        // console.log(response);
        createUserDoocumentFromAuth(user)
    }
    return (
        <div>
        <h1>Sign In Page</h1>
        <button onClick={logGoogleUser}>Sign in wthn Google popup</button>
        </div>
    )
}

export default SignIn
